import React from 'react';

function MyPage() {
  return (
    <div>
      <h1>마이페이지</h1>
      <div>
        <input type="text" placeholder="&&*(투엠퍼센트별)" />
        <input type="password" placeholder="**********" />
        <button>수정 완료 하기</button>
      </div>
    </div>
  );
}

export default MyPage;
